import React from 'react';
import Grid from '@material-ui/core/Grid';
import { FILTER_LABELS } from 'shared/constants/stringConstantsSelectors';
import { VIDEO_GAME_SYSTEMS } from 'shared/constants/domainConstantSelectors';
import { SingleSelect } from '/componentscommon/input/selects/singleSelect';

export const VideoGameFilters = props => {
    return (
        <Grid item xs={2}>
            <SingleSelect 
                handleFilterChange={props.handleFilterChangeBySystem} 
                inputLabel={FILTER_LABELS.SYSTEMS}
                menuItems={VIDEO_GAME_SYSTEMS}
            />
        </Grid>  
    );
};
